import { useState, useEffect } from 'react';
import { getData } from '../../actions/admin'
import { getCookie } from '../../actions/auth'
export default () => { 
  const [data, setData] = useState({})
  const token  = getCookie('token')
  useEffect(() => { 
    getData(token).then(res=>console.log(res))
  },[])
  return (
    <div>blogData</div>
  )
}
